	add("miscegenation", "{\"term\":\"miscegenation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|misceō||mix}} + \u0027genus\u0027 (lang\u003dla) Reportedly coined in an anonymous pamphlet printed in {{w|New York City}} in December 1863, entitled \u0027Miscegenation: The Theory of the Blending of the Races, Applied to the American White Man and Negro\u0027.\u0026lt;ref name\u003d\u0026quot;hoaxes\u0026quot;\u0026gt;{{cite web|title\u003dThe Miscegenation Hoax|url\u003dhttp://www.museumofhoaxes.com/hoax/Hoaxipedia/Miscegenation_Hoax/|work\u003dMuseum of Hoaxes|accessdate\u003d2008-04-02}}\u0026lt;/ref\u0026gt; Replaced previous \u0027amalgamation\u0027 from metallurgy. See {{w|Miscegenatio. Etymological_history|further discussion}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The mixing or blending of race in marriage or breeding, interracial marriage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mixing or blending, especially one which is considered to be inappropriate\", \"priority\":2}]}, \"synonyms\":{}}");

	add("miscellaneum", "{\"term\":\"miscellaneum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Perhaps by back-formation from \u0027miscellanea\u0027 in accordance with the \u0027-um\u0027 → \u0027-a\u0027 rule of plural formation of neuter nouns in the nominative case from the Latin second declension.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A miscellany\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1652\u0027\u0027: Samuel Hartlib, Cornu Copia \u0027: A \u0027\u0027Miscellaneum\u0027\u0027 of lucriferous and most fructiferous Experiments, Observations, and Discoveries, immethodically distributed ; to be really demonstrated and communicated in all Sincerity.\u0027, book title (Harleian Miscellany, volume VI, pages 27–36\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cornu Copia\u0027 : A \u0027\u0027Miscellaneum\u0027\u0027 of lucriferous and most fructiferous Experiments, Observations, and Discoveries, immethodically distributed ; to be really demonstrated and communicated in all Sincerity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027: \u0027The Musical World\u0027, [http://www.google.co.uk/books?id\u003dlZMPAAAAYAAJ\u0026amp;pg\u003dPA129\u0026amp;dq\u003d%22a+miscellaneum%22\u0026amp;lr\u003d\u0026amp;ei\u003daJHbSLSeI6K-tgPh8cTeDg page 129\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The second part was devoted to a \u0027\u0027miscellaneum\u0027\u0027. It commenced with a reference to the interdiction of stage entertainment in the time of the Protectorate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027: Housman Society, \u0027Housman Society Journal\u0027, [http://www.google.co.uk/books?id\u003dQ95aAAAAMAAJ\u0026amp;q\u003d%22this+miscellaneum%22\u0026amp;dq\u003d%22this+miscellaneum%22\u0026amp;lr\u003d\u0026amp;ei\u003drpjbSNDYLYnWjgGEwfTnDg\u0026amp;pgis\u003d1 page 87] (Turner \u0026amp; Devereux\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Aside from those cited in this \u0027\u0027miscellaneum\u0027\u0027, other copies are to be seen at Bryn Mawr (inscribed by Kennerley to R. W. Ellis); Southern Illinois University, Carbondale; and private collection 1\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Shlomo Berger, Michael Brocke, and Irene E Zwiep, \u0027Zutot 2003\u0027, [http://www.google.co.uk/books?id\u003dlOpy0QTtVWMC\u0026amp;pg\u003dPA28\u0026amp;dq\u003d%22this+miscellaneum%22\u0026amp;lr\u003d\u0026amp;ei\u003drpjbSNDYLYnWjgGEwfTnDg\u0026amp;sig\u003dACfU3U0qGJSS7GJfHj8E1Z3lO1vAskWQXg page 28] ([http://www.springer.com/philosophy/history+of+philosophy/book/978-1-4020-2627-0?cm_mmc\u003dGoogle-_-Book%20Search-_-Springer-_-0 Springer]; ISBN 1402026277, 978-1402026270\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In this \u0027\u0027miscellaneum\u0027\u0027 I would like to describe a medieval translation of \u0027Keter Malkhut\u0027 which, to the best of my knowledge, has not been noted anywhere in scholarly literature\", \"priority\":9}]}, \"synonyms\":{}}");

