	add("misfit", "{\"term\":\"misfit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mis|fit|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ill-fitting garment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A failure to fit well; unsuitability, disparity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 94\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And the fact that Christianity\u0027s Jesus is the resurrected Christ makes a vital point about the \u0027\u0027misfit\u0027\u0027 between the Jesus whose teachings we have excavated and the Church which came after him\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A badly adjusted person; someone unsuitable or set apart because of their habits, behaviour etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Adrian Blomfield, \u0026quot;Has Russia got a new Stalin?\u0026quot;, w:The Daily Telegraph, 1 Mar 2008 [http://www.telegraph.co.uk/news/worldnews/1580346/Has-Russia-got-a-new-Stalin.html Article\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Just to be on the safe side, the Kremlin has also banned any of Putin\u0027s serious critics from standing. Three unelectable \u0027\u0027misfits\u0027\u0027 have been allowed to mount token challenges\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She was very unhappy in Iraq and a \u0027\u0027misfit\u0027\u0027 in the Army\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The MBA was a \u0027\u0027misfit\u0027\u0027 when stuck in a meeting with the programmers\", \"priority\":9}]}, \"synonyms\":{}}");

	add("misfortune", "{\"term\":\"misfortune\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"bad luc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, July 15. Richard Williams in Guardian Unlimited, [http://www.guardian.co.uk/sport/2012/jul/15/tour-de-france-2012-bradley-wiggins Tour de France 2012: Carpet tacks cannot force Bradley Wiggins off track\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cycling\u0027s complex etiquette contains an unwritten rule that riders in contention for a race win should not be penalised for sheer \u0027\u0027misfortune\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The worst tour I have ever had the \u0027\u0027misfortune\u0027\u0027 to experience\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It was my fortune, or \u0027\u0027misfortune\u0027\u0027, to be called to the office of Chief Executive without any previous political training.\u0027 - Ulysses S. Gran\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"an undesirable event such as an acciden\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027, Charles Robert Darwin, \u0027[http://www.bartleby.com/29/10.html The Voyage of the Beagle.]\u0027, Chapter\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The snowstorm, which was the cause of their \u0027\u0027misfortune\u0027\u0027, happened in the middle of January, corresponding to our July, and in the latitude of Durham\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She had to come to terms with a number of \u0027\u0027misfortunes\", \"priority\":9}]}, \"synonyms\":{}}");

