	add("misluck", "{\"term\":\"misluck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mis|luck|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"ill Ill luck; misfortune\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Michael von Albrecht, Gareth L. Schmeling, \u0027A History of Roman Literature\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"misluck\u0027\u0027 would have it, however, that this emperor reigned no longer than half a year\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Raymond Hickey, \u0027Irish English\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If Good- for-little had been buried, it had been my Tommy, Who by \u0027\u0027misluck\u0027\u0027 was placed to drive in\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Robert C. Roberts, W. Jay Wood, \u0027Intellectual Virtues\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Your belief is true and justified, but not knowledge. In this case you\u0027re unlucky enough to be driving through a neighborhood beset by deceptive appearances, but this \u0027\u0027misluck\u0027\u0027 is corrected by your just\", \"priority\":7}]}, \"synonyms\":{}}");

