	add("misnomer", "{\"term\":\"misnomer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027mesnomer\u0027 noun use of Anglo-Norman and Old french (842-ca. 1400) verb \u0027mesnomer\u0027 () from \u0027mes-\u0027 () + \u0027nomer\u0027 () (from Latin \u0027nōmināre\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A use of a term that is misleading; a misname\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Calling it a driveway is a bit of a \u0027\u0027misnomer\u0027\u0027, since you don\u0027t \u0027drive\u0027 on it, you \u0027park\u0027 on it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Illinois. Appellate Court, ‎Stephen Davis Porter, \u0027Illinois Appellate reports\u0027 (page 257\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"plaintiff\u0027s misstyling himself as corporation in initial complaint constituted case of \u0027\u0027misnomer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A term that is misleading\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Chinese checkers is a \u0027\u0027misnomer\u0027\u0027 since the game has nothing to do with China\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A term whose sense in common usage conflicts with a technical sense\", \"priority\":7}]}, \"synonyms\":{}}");

