	add("misogynist", "{\"term\":\"misogynist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μισογύνης\u0027 from \u0027μισέω\u0027 (i hate) + \u0027γυνή\u0027 (woman)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who professes misogyny; a hater of women\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who displays prejudice against or looks down upon women\", \"priority\":2}]}, \"synonyms\":{}}");

	add("misogyny", "{\"term\":\"misogyny\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μισογυνία\u0027 and \u0027μισογύνης\u0027 (woman hater) from \u0027μισέω\u0027 (i hate) + \u0027γυνή\u0027 (woman)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hatred of, contempt for, or prejudice against women\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Joanne Marie Greer, David O. Moberg, \u0027Research in the Social Scientific Study of Religion\u0027 (ISBN 0762304839), page 29\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although she argues against a simplistic conflation of types of prejudice, she suggests that \u0027\u0027misogyny\u0027\u0027 is typically present in both narcissistic and obsessive forms of anti-Semitic prejudice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Ethel Spector Person, \u0027The Sexual Century\u0027 (ISBN 0300076045), page 84\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027misogyny\u0027\u0027, like that of his predecessors, is more than prejudice\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Jeff Johnson, \u0027William Inge And The Subversion Of Gender\u0027 (ISBN 0786420626), page 122\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This ontological symbiosis also explains his \u0027\u0027misogyny\u0027\u0027. By envying Sue, as the man he cannot become, he projects his self-loathing onto her, trying to diminish what he actually admires\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Jack Holland, \u0027\u0027\u0027Misogyny\u0027\u0027: the world\u0027s oldest prejudice\u0027 (ISBN 0786718234\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"location\u003dLondon|date\u003d12 April page\u003dR7|passage\u003d I have always found it hard that w:Prince Hamlet, a character that I love and admire, is guilty of a puerile \u0027\u0027misogyny\u0027\u0027 and, perhaps, more worryingly, of the unnecessary deaths of his old friends from university, . When I played him, I could find reasons for the \u0027\u0027misogyny\u0027\u0027 but half-ignored the murders\", \"priority\":9}]}, \"synonyms\":{}}");

	add("misology", "{\"term\":\"misology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μισολογία\u0027 from \u0027μισόλογος\u0027 from \u0027μισέω\u0027 (i hate) + \u0027λόγος\u0027 (account, reason)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hatred or fear of reasoning or argument\", \"priority\":1}]}, \"synonyms\":{}}");

	add("misomania", "{\"term\":\"misomania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"This word comes from the prefix \u0027miso-\u0027 (hatred), and the Latin word \u0027mani. Latin|mania\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mania of hatred for everything\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fear of persecution, or being hated by everyone\", \"priority\":2}]}, \"synonyms\":{}}");

