	add("misotheism", "{\"term\":\"misotheism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Greek μισόθεος \u0026quot;hating the gods\u0026quot;, from μίσος \u0026quot;hatred\u0026quot; and θεός \u0026quot;god\u0026quot;. The Greek compound is found in Aeschylus (\u0027Agamemnon\u0027 1090; compare dystheism). The English word appears as a nonce-coinage, used by T. De Quincey in 1846.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hatred of God or gods\", \"priority\":1}]}, \"synonyms\":{}}");

	add("misprision", "{\"term\":\"misprision\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027mesprison\u0027 \u0027\u0027 et al., from \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Criminal neglect of duty or wrongful execution of official duties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Misinterpretation or misunderstanding\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1595\u0027\u0027, Shakespeare, A Midsummer Night\u0027s Dream, III\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"What hast thou done? thou hast mistaken quit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And laid the love-juice on some true-love\u0027s sight\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Of thy \u0027\u0027misprision\u0027\u0027 must perforce ensu\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Some true love turn\u0027d and not a false turn\u0027d true\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, \u0027Money\u0027, Vintage 2005, p. 331\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"they have what men call self-belief and blame you for your \u0027\u0027misprisions\u0027\u0027 in their dreams, they are conspiracy theorists, benevolent dictators\", \"priority\":9}]}, \"synonyms\":{}}");

	add("misprize", "{\"term\":\"misprize\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027mespriser\u0027 (verb), \u0027\u0027 (noun).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Contempt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He ment to make them know their follies prise, / Had not those two him instantly desired / T\u0027asswage his wrath, and pardon their \u0027\u0027mesprise\u0027\u0027 […\", \"priority\":3}]}, \"synonyms\":{}}");

	add("mispronunciation", "{\"term\":\"mispronunciation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mis|pronunciation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of mispronouncing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She found the constant \u0027\u0027mispronunciation\u0027\u0027 of her name very annoying\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mispronounced word or phrase\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His speech was full of \u0027\u0027mispronunciations\", \"priority\":4}]}, \"synonyms\":{}}");

	add("misregard", "{\"term\":\"misregard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mis|regard|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Wrong understanding; misconstruction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Disregard; failure to heed or consider; contempt; neglect\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1801\u0027\u0027, Bannatyne Club, \u0027Publications - Volume 93, Issue 1 - Page 297\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"As to the duke\u0027s \u0027\u0027misregard\u0027\u0027 of her offer, they did remit the truth of that to the report of the persons employed by herself\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Harry Berger, \u0027Revisionary Play\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"poem does a turnabout as the narrator justifies that \u0026quot;\u0027\u0027misregard\u0027\u0027\u0026quot; by telling the golden-age story from the Censor\u0027s standpoint\", \"priority\":6}]}, \"synonyms\":{}}");

	add("misrelation", "{\"term\":\"misrelation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mis|relation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"erroneous relation or narratio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Archbishop John Bramhall, letter to the Marquis of Newcastl\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But as mine aim, in the first discourse, was only to press home those things in writing which had been agitated between us by word of mouth (a course much to be preferred before verbal conferences, as being freer from passions and tergiversations, less subject to mistakes and \u0027\u0027misrelations\", \"priority\":3}]}, \"synonyms\":{}}");

	add("misrepresentation", "{\"term\":\"misrepresentation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|misrepresent|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Erroneous or false representation; an unfair or dishonest account or exposition; a false statement: as, to injure one\u0027s character by misrepresentations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Incorrect or unfaithful representation in the capacity of agent or official representative, as of a principal in a matter of business, or of constituents in legislation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In map-making, faultiness in a map-projection, estimated with regard to its unequal scale in different parts and to its distortion of angles\", \"priority\":3}]}, \"synonyms\":{}}");

	add("misrespect", "{\"term\":\"misrespect\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mis|respect|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lack of respect; improper respect; disrespect\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Christopher Flockton, Eva Kolinsky, Rosalind M. O. Pritchard, \u0027The new Germany in the East\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Violence extends from harassment in the street or at work to various forms of \u0027\u0027misrespect\u0027\u0027, such as treating individuals as objects, assault and sexual abuse inside and outside the family, as well as rape, the illegal trade in women\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, James Charles Roy, \u0027The Fields Of Athenry: A Journey Through Ireland\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And yet his people report mat the apprehension of your Lordship\u0027s discourtesies and \u0027\u0027misrespect\u0027\u0027 hastened his end, whereof my Lord his son seems very sensible\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Sandra Dallas, \u0027Prayers for Sale\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Maybe she didn\u0027t like it that I was so forward, but I meant no \u0027\u0027misrespect\", \"priority\":7}]}, \"synonyms\":{}}");

	add("misrule", "{\"term\":\"misrule\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mis|rule|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being ruled badly; disorder, lawlessness, anarchy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Misgovernment; bad or unjust government\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Thomas Penn, \u0027Winter King\u0027, Penguin 2012, p. 52\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"But in the recent past, there had been plenty of accusations and instances of Henry\u0027s oppressive \u0027\u0027misrule\u0027\u0027, of which the execution of the earl of Warwick, Suffolk\u0027s cousin, was the most recent and emphatic example\", \"priority\":4}]}, \"synonyms\":{}}");

	add("misser", "{\"term\":\"misser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|miss|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who misses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027misser\u0027\u0027 of the mark\", \"priority\":2}]}, \"synonyms\":{}}");

	add("misshape", "{\"term\":\"misshape\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mis|shape|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A misshapen person; a misshapen body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, V.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The one of them, that elder did appeare, / With her dull eyes did seeme to looke askew, / That her \u0027\u0027mis-shape\u0027\u0027 much helpt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A misshapen object; now especially, a broken item (especially food) sold individually at a cheaper price\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, et al., \u0026quot;Mis-Shapes\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Mis-shapes\u0027\u0027, mistakes, misfits / Raised on a diet of broken biscuits\", \"priority\":6}]}, \"synonyms\":{}}");

	add("missie", "{\"term\":\"missie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|miss|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young woman; miss\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An\u0027 that\u0027s why they took me, missie, that\u0027s why they took me\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"https://books.google.com/books?id\u003dHvVSzKe9FrUC\u0026amp;pg\u003dPA58\u0026amp;dq\u003d%22me,+missie%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dMICcVffCJMHk-AHum4WoBw\u0026amp;ved\u003d0CCoQ6AEwA\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22me%2C%20missie%22\u0026amp;f\u003dfalse Perspectives: A Course in Narrative Comprehension and Composition By Cecil Gray\", \"priority\":4}]}, \"synonyms\":{}}");

	add("missile", "{\"term\":\"missile\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027missile\u0027 from Latin \u0027missilis\u0027 (that may be thrown) neuter \u0027missile|lang\u003dla\u0027 () in plural \u0027missilia\u0027 () from \u0027mittere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An object intended to be launched into the air at a target\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That \u0027\u0027missile\u0027\u0027 is explosive enough to kill hundreds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A self-propelled projectile whose trajectory can be adjusted after having been launched\", \"priority\":3}]}, \"synonyms\":{}}");

	add("missileer", "{\"term\":\"missileer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|missile|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who works with missiles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"13 March 2014\u0027\u0027, \u0027[http://www.theguardian.com/world/2014/mar/13/nuclear-weapons-air-force-officers-cheating-rot US air force documents reveal \u0027rot\u0027 in culture of nuclear weapons officers]\u0027, The Guardian\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Launch officers, or \u0027\u0027missileers\u0027\u0027, entrusted with the keys to the missiles did poorly and, on their own, would have flunked, the records show\", \"priority\":3}]}, \"synonyms\":{}}");

	add("missingness", "{\"term\":\"missingness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|missing|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Absence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1931\u0027\u0027, Vernon Loder, \u0027Death of an Editor\u0027, page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So far, we assume that he took the rifle from the cabinet to throw blame by its \u0027\u0027missingness\u0027\u0027 — I mean, its absence — on some one else\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, \u0027Theology\u0027, vol. 91, page 46\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"However, in examining the influences on Merton, there is one major influence which is missing, and its \u0027\u0027missingness\u0027\u0027 is illustrated by one quotation in which Merton describes the relationship between\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Martin Lass, \u0027Mirror, Mirror, Body and Mind - The Physiological and Psychological Journey\u0027, page 3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That is, feelings of \u0027\u0027missingness\u0027\u0027 and hurt — the usual interpretation of Wound — being lopsided perceptions, each contain the tacit feeling that the opposite can exist on its own\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Missing dat\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The manner in which data are missing from a sample of a populatio\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Arijit Chaudhuri, Horst Stenger, \u0027Survey Sampling: Theory and Methods\u0027, page 28\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In large scale surveys the assumption of \u0027\u0027missingness\u0027\u0027 at random is untenable\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Paul D. Allison, \u0027Missing Data\u0027, Sage Pulications, ISBN 0761916725, p. 8\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"These methods are very sensitive to assumptions made about the \u0027\u0027missingness\u0027\u0027 mechanism or about the distributions of the variables with missing data\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Mamdouh Refaat, \u0027Data Preparation for Data Mining Using SAS\u0027, page 18\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Some imputation models require the data to have a certain distribution of their missing values, their \u0027\u0027missingness\u0027\u0027 pattern\", \"priority\":15}]}, \"synonyms\":{}}");

	add("mission", "{\"term\":\"mission\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From French \u0027mission|lang\u003dfr\u0027 () Old french (842-ca. 1400) \u0027mission\u0027 (expense) from Latin {{m|la|missiō||a sending, sending away, dispatching, discharging, release, remission, cessation}}, from \u0027mitto\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of tasks that fulfills a purpose or duty; an assignment set by an employer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Religious evangelism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the missions) collective term for third world charities, particularly those which preach as well as provide aid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Catholic tradition) an infrequent gathering of religious believers in a parish, usually part of a larger regional event with a central theme\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A number of people appointed to perform any service; a delegation; an embassy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In these ships there should be a \u0027\u0027mission\u0027\u0027 of three of the fellows or brethren of Solomon\u0027s house\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"dismissal; discharge from servic\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A or serving as a base for work\", \"priority\":9}]}, \"synonyms\":{}}");

	add("missionary", "{\"term\":\"missionary\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mission|ary|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is sent on a mission\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who travels attempting to spread a religion or a creed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Muslim \u0027\u0027missionary\u0027\u0027 was just trying to convert me to Islam\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A religious messenger\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A common position for undertaking sexual intercourse\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mississauga", "{\"term\":\"mississauga\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Ojibwe\"], \"text\":\"From French \u0027mississague\u0027 from Ojibwe \u0027misizaagii\u0027 (inhabitant of large river mouth) (with reference to the area where the Mississauga River drains into Lake Huron).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Algonquian people now living in southern Ontario, Canada; also a member of this race\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mississippi", "{\"term\":\"mississippi\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Ojibwe\"], \"text\":\"From Ojibwe \u0027misi-ziibi\u0027 (great river) or \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A . Capital Jackson: Postal abbreviation: \u0027\u0027MS\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A major river in North America that rises in Minnesota and flows into the Gulf of Mexico\", \"priority\":2}]}, \"synonyms\":{}}");

	add("missive", "{\"term\":\"missive\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"15th Century; from Medieval Latin \u0027\u0027 from \u0027mittere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A written message; a letter, note or memo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Claire Armistead, \u0027The Guardian\u0027, [http://www.guardian.co.uk/books/2008/oct/25/biography 25 Oct 2008\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Madonna letters, which are interspersed with more personal \u0027\u0027missives\u0027\u0027 in this curious epistolary memoir, accumulate into a rap about the downsides of celebrity - the problems of ageing, of invaded privacy, of becoming vain and impetuously adopting children from other continents\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, Herman Melville, \u0027Moby-Dick\u0027, [http://www.gutenberg.org/dirs/etext01/moby10b.txt Chapter 71\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Curses throttle thee!\u0026quot; yelled Ahab. \u0026quot;Captain Mayhew, stand by now to receive it\u0026quot;; and taking the fatal \u0027\u0027missive\u0027\u0027 from Starbuck\u0027s hands, he caught it in the slit of the pole, and reached it over towards the boat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who is sent; a messenger\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Whiles I stood rapt in the wonder of it came missives from the King, who all hailed me ‘Thane of Cawdor,’ by which title these Weird Sisters saluted me and referred me to the coming on of time with ‘Hail king that shalt be.’\", \"priority\":7}]}, \"synonyms\":{}}");

	add("missouri", "{\"term\":\"missouri\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"miami\"], \"text\":\"From Miami \u0027wimihsoorita\u0027 (\u0026quot;the people who have dugout canoes\u0026quot;), a term for the inhabitants of the area around the Missouri River.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Capital Jefferson City; largest city: Kansas City: Postal abbreviation: \u0027\u0027MO\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The longest river in the United States, flowing from Montana to become a tributary of the Mississippi at Saint Louis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Native American tribe that originally lived in the Great Lakes region of United States\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An organized territory in the United States during the nineteenth century\", \"priority\":4}]}, \"synonyms\":{}}");

	add("misspelling", "{\"term\":\"misspelling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mis|spelling|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A misspelt word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"“Accomodation” is a common \u0027\u0027misspelling\u0027\u0027 of “accommodation”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 September, John H. Jenkins, \u0027The Dao of Unihan\u0027, International \u0026amp; Text Group, Apple Computer, Inc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"My own Chinese name might conceivably be written in no fewer than four different ways in Unicode: 井作恆, 井作恒, 丼作恆, and 丼作恒. I would personally consider all but the first \u0027\u0027misspellings\u0027\u0027, just as I would the spelling of my English name as Jon Jenkins or John Jenkyns\", \"priority\":4}]}, \"synonyms\":{}}");

	add("missus", "{\"term\":\"missus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Representing a typical pronunciation of \u0027\u0027Mrs\u0027\u0027, a corrupted form of \u0027Mistress\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Harry said he couldn\u0027t stop and chat because his \u0027\u0027missus\u0027\u0027 wanted to go shopping\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027missus\u0027\u0027 has a list of chores for me to do this weekend\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mistake", "{\"term\":\"mistake\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old norse\"], \"text\":\"From Middle english (1100-1500) {{m|enm|mistaken}}, from Old norse \u0027mistaka\u0027 (lang\u003dnon) equivalent to {{prefix|mis|take|lang\u003den}}. Cognate with Icelandic {{m|is|mistaka||to mistake}}, Swedish {{m|sv|misstaga||to mistake}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An error; a blunder\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1877\u0027\u0027, Henry Heth, quoting w:Robert E. Robert E. Lee, in \u0026quot;Causes of the Defeat of Gen. Lee\u0027s Army at the Battle of GettysburgOpinions of Leading Confederate Soldiers.\u0026quot;, \u0027Southern Historical Society Papers\u0027 (1877), editor Rev. J. WM. Jones [http://books.google.com/books?id\u003diDIFAAAAQAAJ\u0026amp;pg\u003dPA292\u0026amp;dq\u003dlee+%22mistakes+were+made%22\u0026amp;hl\u003den\u0026amp;ei\u003dfchaTbu4L8L98AaVs4n-DQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dlee%20%22mistakes%20were%20made%22\u0026amp;f\u003dfalse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"After it is all over, as stupid a fellow as I am can see that \u0027\u0027mistakes\u0027\u0027 were made. I notice, however, that my \u0027\u0027mistakes\u0027\u0027 are never told me until it is too late\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A pitch which was intended to be pitched in a hard to hit location, but instead ends up in an easy to hit place\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mistigri", "{\"term\":\"mistigri\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A card game, resembling poker, in which the joker is used\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mistigris", "{\"term\":\"mistigris\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"card game\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mistle", "{\"term\":\"mistle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Old English \u0027miste. Old English|mistel\u0027, from Germanic \u0027*mixstilaz\u0027. Cognate with Dutch \u0027miste. Dutch|mistel\u0027, German \u0027Mistel\u0027, Swedish \u0027miste. Swedish|mistel\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"mistleto\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the mistle thrush\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mistletoe", "{\"term\":\"mistletoe\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|*mistelto}}, alteration (due to the final \u0027-n\u0027 being mistaken for the old plural ending) of {{m|enm|*mistelton}}, from Old english (ca. 450-1100) {{m|ang|misteltān}}, {{m|ang|mistiltān||mistletoe}}, from {{m|ang|mistel||birdlime, mistletoe, basil}} + {{m|ang|tān||twig, sprig}}, equivalent to {{compound|mistle|tan|lang\u003den}}. Cognate with Danish {{m|da|mistelten}}, Icelandic {{m|is|mistilteinn}}. More at {{l/en|mistle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several hemiparasitic evergreen plants with white berries that grow in the crowns of oaks, apple trees and other trees\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d23 December passage\u003d[T]he stickiness [of mistletoe berries] persists through the gut, making it hard to defecate \u0027\u0027mistletoe\u0027\u0027 seeds with any grace. To deal with this, birds like the silky flycatcher, Phainopepla nitens, that are \u0027\u0027mistletoe\u0027\u0027 specialists, have evolved a \u0026quot;waggle dance\u0026quot;\u0026amp;nbsp;– also known as butt-wiping behavior\u0026amp;nbsp;– where they clean up by rubbing themselves against twigs. Indeed, the association with bird droppings may even be the origin of the word: Some evidence suggests that \u0026quot;\u0027\u0027mistletoe\u0027\u0027\u0026quot; comes from Anglo-Saxon for \u0026quot;dung on a twig.\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sprig of these plants used as a Christmas decoration\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"date\u003d23 December passage\u003d\u0027\u0027Mistletoe\u0027\u0027. The word conjures winter holidays, office parties, stolen kisses, romance. But appreciation of the plant is no modern thing. Kissing under the \u0027\u0027mistletoe\u0027\u0027 has been happening for at least 200 years. And some 2,000 years ago, the druids in which is now Britain venerated the plant when it grew on an oak. When they found it, they dressed in white, harvested it with a golden sickle, and sacrificed two white bulls. Or so says that great Roman, in his \u0026quot;w:Natural History Natural History.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("mistletoebird", "{\"term\":\"mistletoebird\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|mistletoe|bird|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Australian flowerpecker, that commonly eats and thereby serves to spread mistletoe\", \"priority\":1}]}, \"synonyms\":{}}");

