	add("mistress", "{\"term\":\"mistress\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) and Old french (842-ca. 1400) \u0027maistresse\u0027 (French: \u0027maîtresse\u0027 , feminine of \u0027maistre\u0027 (master)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman, specifically one with great control, authority or ownership\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAt the far end of the houses the head gardener stood waiting for his \u0027\u0027mistress\u0027\u0027, and he gave her strips of bass to tie up her nosegay. This she did slowly and laboriously, with knuckly old fingers that shook\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A female teacher\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A female partner in an extramarital relationship, generally including sexual relations\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A dominatrix\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Amelia May Kingston, \u0027The Triumph of Hope\u0027 (page 376\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As part of BDSM play they can enhance the domineering tread of a \u0027\u0027mistress\u0027\u0027 or hobble the steps of a slave\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A woman well skilled in anything, or having the mastery over it\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A letter desires all young wives to make themselves \u0027\u0027mistresses\u0027\u0027 of Wingate\u0027s Arithmetic\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A woman regarded with love and devotion; a sweetheart\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A married woman; a wife\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Several of the neighbouring \u0027\u0027mistresses\u0027\u0027 had assembled to witness the event of this memorable evening\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The jack in the game of bowls\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"female companion to a master\", \"priority\":15}]}, \"synonyms\":{}}");

